import React from 'react'
import { Button } from "react-bootstrap";




export default function Upload() {
    return (
        <div className="container">
            <h1>Upload</h1>
            <section className="container right-signup-area">
          {/* <form className="form-signin col-6 container" method="POST"> */}
          <div
            style={{
              display: "flex",
              justifyContent: "flex-end",
              marginRight: "30px",
              marginTop: "50px"
            }}
          >
            <p>Already member?</p>

            <a href="#" className="signup-link">
              <Link
                to="/signin"
                style={{ color: "#EA4C89", marginLeft: "10px" }}
              >
                Sign In
              </Link>
            </a>
          </div>
          <div>
          <form className="form-signin ">
            <h3
              style={{
                fontWeight: "600",
                color: "#333333",
                marginTop: "30px",
                marginBottom: "20px"
              }}
            >
              Sign Up To Panoko
            </h3>
            <p style={{ fontWeight: "600" }}>Email</p>
            <input
              style={{ marginBottom: "20px" }}
              type="email"
              id="inputEmail"
              className="form-control"
              placeholder="Email address"
              required=""
              value={email}
              onChange={e => {
                setEmail(e.target.value);
              }}
            />
            <p style={{ fontWeight: "600" }}>Frist Name</p>
            <input
              style={{ marginBottom: "20px" }}
              type="text"
              id="inputEmail"
              className="form-control"
              placeholder="Frist Name"
              required=""
              value={firstName}
              onChange={e => {
                setFirstName(e.target.value);
              }}
            />
            <p style={{ fontWeight: "600" }}>Last Name</p>
            <input
              style={{ marginBottom: "20px" }}
              type="text"
              id="inputEmail"
              className="form-control"
              placeholder="Last Name"
              required=""
              value={lastName}
              onChange={e => {
                setLastName(e.target.value);
              }}
            />
            <p style={{ fontWeight: "600" }}>Password</p>
            <input
              style={{ marginBottom: "20px" }}
              type="password"
              id="inputPassword"
              className="form-control"
              placeholder="Password"
              required=""
              value={password}
              onChange={e => {
                setPassword(e.target.value);
              }}
            />
            <div className="checkbox mb-3">
              <label>
                <input type="checkbox" value="remember-me" />
                Remember me
              </label>
            </div>
            <button
              className="btn btn-lg btn-primary btn-block signin-btn-v2"
              type="submit"
              onClick={singUp}
            >
              Sign Up
            </button>
            {/* <p className="mt-5 mb-3 text-muted">Â© 2017-2019</p> */}
            {/* </form> */}
          </form>
          </div>
        </section>
        </div>
    )
}
